import 'package:freezed_annotation/freezed_annotation.dart';part 'ReportRequest.freezed.dart';part 'ReportRequest.g.dart';@Freezed()class ReportRequest with _$ReportRequest {  const factory ReportRequest(      {@JsonKey(name: 'LoginID') required String loginId,        @JsonKey(name: 'WingID') required String wingId,        @JsonKey(name: 'RequestFlag') required String requestFlag,      }) =  _ReportRequest;  factory ReportRequest.fromJson(Map<String, dynamic> json) =>      _$ReportRequestFromJson(json);}